(1, 'addons', 'a:8:{i:0;O:8:\"stdClass\":15:{s:3:\"sku\";s:16:\"aioseo-redirects\";s:4:\"name\";s:19:\"Redirection Manager\";s:7:\"version\";s:6:\"1.2.13\";s:5:\"image\";N;s:4:\"icon\";s:480:\"\";s:6:\"levels\";a:4:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:3:\"pro\";i:3;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:101:\"<p>Our Redirection Manager allows you to create and manage redirects for 404s or modified posts.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:48:\"https://aioseo.com/features/redirection-manager/\";s:12:\"learnMoreUrl\";s:48:\"https://aioseo.com/features/redirection-manager/\";s:9:\"manageUrl\";s:30:\"https://route#aioseo-redirects\";s:8:\"features\";a:1:{i:0;O:8:\"stdClass\":2:{s:13:\"license_level\";s:5:\"elite\";s:7:\"feature\";s:19:\"404-parent-redirect\";}}}i:1;O:8:\"stdClass\":15:{s:3:\"sku\";s:21:\"aioseo-link-assistant\";s:4:\"name\";s:14:\"Link Assistant\";s:7:\"version\";s:6:\"1.0.16\";s:5:\"image\";N;s:4:\"icon\";s:516:\"\";s:6:\"levels\";a:3:{i:0;s:6:\"agency\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:283:\"<p>Super-charge your SEO with Link Assistant! Get relevant suggestions for adding internal links to older content as well as finding any orphaned posts that have no internal links. Use our reporting feature to see all link suggestions or add them directly from any page or post.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:39:\"https://aioseo.com/docs/link-assistant/\";s:12:\"learnMoreUrl\";s:39:\"https://aioseo.com/docs/link-assistant/\";s:9:\"manageUrl\";s:35:\"https://route#aioseo-link-assistant\";s:8:\"features\";a:0:{}}i:2;O:8:\"stdClass\":15:{s:3:\"sku\";s:20:\"aioseo-video-sitemap\";s:4:\"name\";s:13:\"Video Sitemap\";s:7:\"version\";s:6:\"1.1.13\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:5:{i:0;s:10:\"individual\";i:1;s:8:\"business\";i:2;s:6:\"agency\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:243:\"<p>The Video Sitemap works in much the same way as the XML Sitemap module, it generates an XML Sitemap specifically for video content on your site. Search engines use this information to display rich snippet information in search results.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:54:\"https://aioseo.com/docs/how-to-create-a-video-sitemap/\";s:12:\"learnMoreUrl\";s:54:\"https://aioseo.com/docs/how-to-create-a-video-sitemap/\";s:9:\"manageUrl\";s:43:\"https://route#aioseo-sitemaps:video-sitemap\";s:8:\"features\";a:0:{}}i:3;O:8:\"stdClass\":15:{s:3:\"sku\";s:21:\"aioseo-local-business\";s:4:\"name\";s:18:\"Local Business SEO\";s:7:\"version\";s:6:\"1.2.18\";s:5:\"image\";N;s:4:\"icon\";s:18:\"svg-local-business\";s:6:\"levels\";a:5:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:3:{i:0;s:4:\"plus\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:253:\"<p>Local Business schema markup enables you to tell Google about your business, including your business name, address and phone number, opening hours and price range. This information may be displayed as a Knowledge Graph card or business carousel.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:43:\"https://aioseo.com/docs/local-business-seo/\";s:12:\"learnMoreUrl\";s:43:\"https://aioseo.com/docs/local-business-seo/\";s:9:\"manageUrl\";s:40:\"https://route#aioseo-local-seo:locations\";s:8:\"features\";a:0:{}}i:4;O:8:\"stdClass\":15:{s:3:\"sku\";s:19:\"aioseo-news-sitemap\";s:4:\"name\";s:12:\"News Sitemap\";s:7:\"version\";s:6:\"1.0.15\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:4:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:3:\"pro\";i:3;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:284:\"<p>Our Google News Sitemap lets you control which content you submit to Google News and only contains articles that were published in the last 48 hours. In order to submit a News Sitemap to Google, you must have added your site to Google’s Publisher Center and had it approved.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:60:\"https://aioseo.com/docs/how-to-create-a-google-news-sitemap/\";s:12:\"learnMoreUrl\";s:60:\"https://aioseo.com/docs/how-to-create-a-google-news-sitemap/\";s:9:\"manageUrl\";s:42:\"https://route#aioseo-sitemaps:news-sitemap\";s:8:\"features\";a:0:{}}i:5;O:8:\"stdClass\":15:{s:3:\"sku\";s:16:\"aioseo-index-now\";s:4:\"name\";s:8:\"IndexNow\";s:7:\"version\";s:6:\"1.0.11\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:6:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:5:\"basic\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";i:5;s:5:\"elite\";}s:13:\"currentLevels\";a:4:{i:0;s:5:\"basic\";i:1;s:4:\"plus\";i:2;s:3:\"pro\";i:3;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:193:\"<p>Add IndexNow support to instantly notify search engines when your content has changed. This helps the search engines to prioritize the changes on your website and helps you rank faster.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:28:\"https://aioseo.com/index-now\";s:12:\"learnMoreUrl\";s:28:\"https://aioseo.com/index-now\";s:9:\"manageUrl\";s:45:\"https://route#aioseo-settings:webmaster-tools\";s:8:\"features\";a:0:{}}i:6;O:8:\"stdClass\":15:{s:3:\"sku\";s:15:\"aioseo-rest-api\";s:4:\"name\";s:8:\"REST API\";s:7:\"version\";s:5:\"1.0.6\";s:5:\"image\";N;s:4:\"icon\";s