(1, 1, '2023-05-05 04:17:36', '2023-05-05 04:17:36', '<!-- wp:paragraph -->\r\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\r\n<!-- /wp:paragraph -->', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2023-09-14 14:40:36', '2023-09-14 14:40:36', '', 0, 'http://localhost/osaka/?p=1', 0, 'post', '', 1),
(2, 1, '2023-05-05 04:17:36', '2023-05-05 04:17:36', '<!-- wp:paragraph -->\r\n<h4 class=\"title toggle\">HỖ TRỢ KHÁCH HÀNG MUA ONLINE</h4>\r\n<div class=\"box-toggle\">\r\n<p>Hotline: 1800 1100</p>\r\n<p>Giờ làm việc: 9-17h thứ 2 - 6</p>\r\n<p>Email: info@onoff.vn</p>\r\n<p>Địa chỉ: 121 Chùa Bộc, Quang Trung, Đống Đa, Hà Nội</p>\r\n</div>\r\n<h4 class=\"title toggle\">VĂN PHÒNG HÀ NỘI</h4>\r\n<div class=\"box-toggle\">\r\n<p>Điện thoại: +8424 73082005</p>\r\n<p>Fax: +8424 6251 2868</p>\r\n<p>Email: onoff@onoff.vn</p>\r\n<p>Địa chỉ: 121 Chùa Bộc, Quang Trung, Đống Đa, Hà Nội</p>\r\n</div>\r\n<h4 class=\"title toggle\">LIÊN HỆ LÀM NHÀ PHÂN PHỐI VÀ ĐẠI LÝ</h4>\r\n<h5 class=\"title toggle\">MIỀN BẮC</h5>\r\n<div class=\"box-toggle\">\r\n<p>Mr Nguyễn Khánh Mạnh</p>\r\n<p>Điện thoại: 0886.802.288</p>\r\n<p>Email: manhnk@canifa.com</p>\r\n</div>\r\n<h5 class=\"title toggle\">MIỀN NAM</h5>\r\n<div class=\"box-toggle\">\r\n<p>Mr Vũ Việt Dũng</p>\r\n<p>Điện Thoại: 0902.060.515</p>\r\n<p>Email: dung.vv@onoff.vn</p>\r\n</div>\r\n<h4 class=\"title toggle\">NHÀ MÁY</h4>\r\n<div class=\"box-toggle\">\r\n<p>Đường Nguyễn Văn Linh, Phường Bần Yên Nhân, T.X Mỹ Hào, Hưng Yên</p>\r\n<p>Điện thoại: +84-221-394 2234</p>\r\n<p>Fax: +84-221-394 2235</p>\r\n</div>\r\n<!-- /wp:paragraph -->', 'Liên hệ', '', 'trash', 'closed', 'open', '', 'lien-he__trashed', '', '', '2023-09-15 01:47:42', '2023-09-15 01:47:42', '', 0, 'http://localhost/osaka/?page_id=2', 0, 'page', '', 0),
(3, 1, '2023-05-05 04:17:36', '2023-05-05 04:17:36', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost/osaka.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->', 'Privacy Policy', '', 'trash', 'closed', 'open', '', 'privacy-policy__trashed', '', '', '2023-09-11 13:13:32', '2023-09-11 13:13:32', '', 0, 'http://localhost/osaka/?page_id=3', 0, 'page', '', 0),
