(272, 1, '2023-09-16 10:49:40', '2023-09-16 03:49:40', '<a href=\"http://localhost/osaka/wp-content/uploads/2023/09/bep_don_hong_ngoai_dqt-100_baad950b23c14e139390912bed8ebc9e_grande.webp\"><img class=\"alignnone wp-image-273\" src=\"http://localhost/osaka/wp-content/uploads/2023/09/bep_don_hong_ngoai_dqt-100_baad950b23c14e139390912bed8ebc9e_grande-300x131.webp\" alt=\"\" width=\"463\" height=\"202\" /></a>\r\n\r\n<strong>Thiết kế:</strong>\r\n<ul>\r\n 	<li>Kiểu dáng đẹp, mỏng, màn hình LED 4 số.</li>\r\n 	<li>Thiết kế tính năng khóa phím an toàn sử dụng.</li>\r\n 	<li>Thiết kế tiết kiệm năng lượng.</li>\r\n 	<li>Chức năng hẹn giờ.</li>\r\n</ul>\r\n<strong>Chất liệu:</strong>\r\n<ul>\r\n 	<li>Sử dụng kính pha lê cường lực cao cấp Osaka: Chịu nhiệt độ cao, dễ lau chùi.</li>\r\n</ul>\r\n<a href=\"http://localhost/osaka/wp-content/uploads/2023/09/dqt100-003_3f46eaae74a84acf8d60f48eeb5f2180_grande.webp\"><img class=\"alignnone wp-image-275\" src=\"http://localhost/osaka/wp-content/uploads/2023/09/dqt100-003_3f46eaae74a84acf8d60f48eeb5f2180_grande-300x131.webp\" alt=\"\" width=\"472\" height=\"206\" /></a>\r\n\r\n<strong>Công nghệ:</strong>\r\n\r\n<a href=\"http://localhost/osaka/wp-content/uploads/2023/09/dqt100-002_74af0b0d36fc444182ccb63f097b4f56_grande.webp\"><img class=\"alignnone wp-image-276\" src=\"http://localhost/osaka/wp-content/uploads/2023/09/dqt100-002_74af0b0d36fc444182ccb63f097b4f56_grande-300x131.webp\" alt=\"\" width=\"474\" height=\"207\" /></a>\r\n<ul>\r\n 	<li>Công nghệ mâm điện EGO 1 vòng nhiệt. Điều khiển bằng cảm ứng.</li>\r\n 	<li>Sử dụng được tất cả các loại nồi, kể cả nồi thủy tinh và nồi đất.</li>\r\n</ul>\r\n<a href=\"http://localhost/osaka/wp-content/uploads/2023/09/bepquang1-5_d72a852dbad043c2907db5bd479e9e74_grande.webp\"><img class=\"alignnone wp-image-277\" src=\"http://localhost/osaka/wp-content/uploads/2023/09/bepquang1-5_d72a852dbad043c2907db5bd479e9e74_grande-300x82.webp\" alt=\"\" width=\"479\" height=\"131\" /></a>\r\n\r\n<strong>C