(71, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Help WooCommerce improve with usage tracking', 'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://localhost/osaka/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-13 06:45:45', NULL, 0, 'plain', '', 0, 1, 'info'),
(72, 'payoneer_q2_2023', 'marketing', 'en_US', 'Grow with the next generation of payment processing', 'Ready to stand out in the new global economy? Payoneer Checkout gives you the power to securely accept payments worldwide, build a checkout that customers love, and manage your store’s transactions and finances – all from the same place.', '{}', 'unactioned', 'woocommerce.com', '2023-05-14 14:36:24', NULL, 0, 'plain', '', 0, 1, 'info'),
(73, 'wc-admin-coupon-page-moved', 'update', 'en_US', 'Coupon management has moved!', 'Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.', '{}', 'unactioned', 'woocommerce-admin', '2023-05-15 03:52:47', NULL, 0, 'plain', '', 0, 0, 'info'),
