(83, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(84, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(85, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(86, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(87, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(88, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(89, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(90, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(91, 'tiktok_shopGTM_q3-2023_hasTikTok', 'marketing', 'en_US', 'You can now sell your products on TikTok Shop', 'TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.', '{}', 'pending', 'woocommerce.com', '2023-09-07 06:16:19', NULL, 0, 'plain', '', 0, 0, 'info'),
(92, 'tiktok_shopGTM_q3-2023_noTikTok', 'marketing', 'en_US', 'You can now sell your products on TikTok Shop', 'TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.', '{}', 'pending', 'woocommerce.com', '2023-09-08 12:08:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(93, 'klaviyo_q3_2023', 'marketing', 'en_US', 'Build long lasting relationships with Klaviyo for WooCommerce', 'Increase customer engagement and boost conversions with powerful email and SMS automation from Klaviyo. Fully integrated with your Woo store, Klaviyo enables you to send personalized communications to your customers — ensuring that the right message is delivered at the right time for maximum impact.', '{}', 'pending', 'woocommerce.com', '2023-09-12 12:24:16', NULL, 0, 'plain', '', 0, 0, 'info'),
(94, 'wc-admin-test-checkout', 'info', 'en_US', 'Đừng quên kiểm tra chức năng thanh toán', 'Make sure that your checkout is working properly before you launch your store. Go through your checkout process in its entirety: from adding a product to your cart, choosing a shipping location, and making a payment.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-16 04:18:23', NULL, 0, 'plain', '', 0, 0, 'info'),
(95, 'wc-admin-new-sales-record', 'info', 'en_US', 'New sales record!', 'Woohoo, 09/16/2023 was your record day for sales! Net sales was 6.353.121 đ beating the previous record of 141 đ set on 05/08/2023.', '{\"old_record_date\":\"2023-05-08\",\"old_record_amt\":141,\"new_record_date\":\"2023-09-16\",\"new_record_amt\":6353121}', 'unactioned', 'woocommerce-admin', '2023-09-17 05:59:01', NULL, 0, 'plain', '', 0, 0, 'info');
